import { Link } from "react-router-dom";
//style
import './recipelist.css';

export default function Recipt({data}) {
  return (
      <div className="wrapper">
       {data.map(val => (
                <div key={val.id} className='card-container'>
                    <h1>{val.name}</h1>
                    <p>{val.username}</p>
                    <p>{val.email}</p>
               <div> {val.company.catchPhrase.substring(0, 20)}...</div>
               <div className = "recipe-link"><Link Link to = { `/recipe/${val.id}` } >Clike here</Link></div>
                </div>
       ))}
      </div>
  )
}
